Prazos/Cronograma:

A entrega deverá ocorrer conforme solicitação da Secretaria de Saúde, no prazo de até 15 dias após o recebimento da Nota de Empenho.

A primeira remessa de materiais devem ser entregues de imediato, devendo as Notas de Empenho ser emitida na modalidade ORDINÁRIA, para o fornecimento dos materiais/bens.

O prazo para assinatura do contrato e/ou retirada da nota de empenho será de até 5 (cinco) dias úteis da comunicação ao fornecedor.



Recebimento:

Os volumes serão entregues á Comissão de Recebimento:

Provisoriamente: imediatamente depois de efetuada a entrega, no prazo de até 10 (dez) dias para efeito de posterior verificação da conformidade dos produtos com as especificações. O recebimento supra referido dar-se-á através de recibo aposto na nota fiscal quando da sua entrega;

Definitivamente: depois de concluída a vistoria e encerrado o prazo de observação, que não poderá exceder 10 (dez) dias, salvo caso devidamente justificado, comprovada a adequação do objeto nos termos contratuais e consequente aceitação;

O recebimento provisório ou definitivo não exclui a responsabilidade civil pela solidez e segurança do material, nem ético profissional pela perfeita execução do contrato, dentro dos limites estabelecidos pela Lei ou instrumento contratual;

Se, após o recebimento provisório, for constatado que os materiais foram entregues de forma incompleta ou em desacordo com as especificações ou com a proposta, após a notificação do contratado, será interrompido o prazo de recebimento definitivo e suspenso o prazo de pagamento até que seja sanada a situação;

A empresa vencedora de cada item ficará obrigada a trocar, às suas expensas, o que for recusado por apresentar-se contraditório à Ordem de Fornecimento e/ou distintos dos ofertados, ou qualquer outra coisa que estiver em desacordo com o disposto neste instrumento e seus anexos;

As embalagens deverão ser adequadas para armazenagem de maneira que garanta a integridade dos materiais;
